import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
     <h1>App</h1>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
    </div>
  );
}

export default App;
